import classes from "./Skill.module.css";
import React from "react";

const Skill = (props) => {
  let proficiencyBlocks = [];
  for (var i = 0; i < props.value && i < 10; i++) {
    if(i === props.value - 1) {
        proficiencyBlocks.push(<div className={classes.skillBlock}>{props.value}</div>);
    } else {
        proficiencyBlocks.push(<div className={classes.skillBlock}></div>);
    }
  }
  console.log(proficiencyBlocks);
  console.log(props);
  return (
    <div className={classes.skillBox}>
      <p>{props.name}</p>
      <div className={classes.proficiencyBox}>{proficiencyBlocks}</div>
    </div>
  );
};

export default Skill;
